  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset represents the Lidar elevations
  for Silver Falls State Park in Marion County, Oregon. The LiDAR data was collected
  during March 2007. This was a leaf-off condition. The lidar data are multiple return
  and bare earth classified. An Optech 3100 LiDAR system was mounted in a fixed-wing
  aircraft and flown 900 meters above ground level (AGL). A pulse repetition frequency
  (PRF) of 71 kHz with at least 100% overlap (minimum 50% side-lap) was used. Greater
  than 8 points per square meter and near nadir scan angles were used to increase
  penetration of vegetation to ground surfaces. Ground level GPS and aircraft IMU
  were collected during the flight. In some areas of heavy vegetation or forest cover,
  there may be relatively few ground points in the LiDAR data. Elevation values for
  open water surfaces are not valid elevation values because few LiDAR points are
  returned from water surfaces. Watershed Sciences, Inc. collected the LiDAR and created
  this data set for Oregon Parks and Recreation.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
